import './index.c';

import React from 'react';
import ReactDOM from 'react-dom';

import { BrowserRouter } from 'react-router-dom';

import App from './App';

const root = ReactDOM.createRoot(document.getElementById('app'))

root.render(
    <BrowserRouter>
    <App/>
    </BrowserRouter>
);
